var vm=new Vue({el:"html",data:{page:"news",loading:!0,logs:0,list:[]},methods:{getLogs:function(){var t=this;$.get("/api/getLog",function(e){t.loading=!1;var o=JSON.parse(e);console.log(o),o.status>0&&(t.list=o.list)})},getNums:function(){var t=this;$.get("/api/getNum",function(e){var o=JSON.parse(e);console.log(o),1==o.status&&(t.logs=o.number)})}},computed:{},ready:function(){var t=this;t.getLogs(),t.getNums(),setTimeout(function(){t.loading===!0&&layer.open({content:"网络延迟，请重新加载"})},8e3)}});